INSERT INTO `ow_project_description` VALUES ('acceleo','Acceleo is a code generator which uses the MDA approach to easily design applications with models. Acceleo is natively based on Eclipse EMF and can be extended to target any technology.',122,'2008-03-31 20:53:12'),('activexml','Active XML is a declarative framework based on XML documents with embedded calls to Web services that harnesses web services for data management and is put to work in a peer-to-peer architecture.',122,'2008-03-31 20:53:12'),('apollon','Generation engine able to build graphical user interfaces (GUI) from DTDs and customization models. This makes the GUIs adapted to the edition of XML documents.',122,'2008-03-31 20:53:12'),('barracudamvc','Barracuda is an open-source Presentation Framework designed to make it easier to build servlet based webapps by applying proven client-server patterns to the web development paradigm. It includes a DOM based templating mechanism for better separation',122,'2008-03-31 20:53:13'),('been','BEEN: Framework for Integrating Performance Evaluation in Development Cycle',122,'2008-03-31 20:53:13'),('bonita','Bonita provides out of the box workflow functionalities to define and run business processes : enactment engine, APIs, process definition tool and administrative application',122,'2008-03-31 20:53:13'),('bpmadmin','NovaBPM is reference open source BPM platform embedding Bonita XPDL Workflow and Orchestra BPEL projects',122,'2008-03-31 20:53:13'),('bsframework','The Bright Side Framework provides ready-to-use high level components to quickly build J2EE business applications accessed by rich java/Swing clients on HTTP.',122,'2008-03-31 20:53:13'),('cardamom','CARDAMOM is a middleware framework that provides features to configure, deploy and execute near real-time, distributed and fault-tolerant applications.',122,'2008-03-31 20:53:13'),('carol','CAROL (Common Architecture for RMI Objectweb Layer) is a Java RMI (Remote Methods Invocation) management tool.',122,'2008-03-31 20:53:13'),('celtix','Celtix delivers a Java enterprise service bus (ESB) runtime and set of extensibility APIs, simplifying the construction, integration and flexible reuse of technical and business components using a standards-based, service-oriented architecture.',122,'2008-03-31 20:53:13'),('clif','CLIF provides a flexible, extensible Java-based platform for scalable, distributed load injection and performance testing. With the Eclipse-based GUI, use provided or custom load injectors and probes, and run up to millions of vUsers per injector!',122,'2008-03-31 20:53:13'),('cow','Cooperative Open Workflow is a flexible workflow engine that can handle cooperative work activities',122,'2008-03-31 20:53:13'),('director','Enhydra Director implements web server plugins for Apache, IIS and IPlanet supporting advanced load balancing / clustering and runtime administration. Director can be used with plain Tomcat, Jetty, JBoss, JOnAS or Enhydra Server.',122,'2008-03-31 20:53:14'),('dods','Enhydra DODS is a code generating O/R mapping tool with true SQL queries for predictable performance, configurable templates and data/query caching. Can be used in standalone applications, every application server and of course with Enhydra Server.',122,'2008-03-31 20:53:14'),('dotnetj','DotNetJ is a middleware that gives .NET clients the ability to use Java components or J2EE applications. This project aims at providing .NET-to-Java interoperability without the bottleneck of web services.',122,'2008-03-31 20:53:14'),('dream','Dream is a component-based software framework dedicated to the construction of communication middleware. It provides a component library (based on Fractal) and tools allowing the construction of various communication paradigms.',122,'2008-03-31 20:53:14'),('dryverl','Dryverl is an XML dialect for specifying Erlang-to-C bindings as C port drivers, and a set of XSLT stylesheets that generate all of a binding\'s Erlang and C source code.',122,'2008-03-31 20:53:14'),('dysoweb','Dysoweb provides modularity and dynamicity to serlvet based web applications. Based on OSGi it allows the dynamic deployment of services packaged as bundles.',122,'2008-03-31 20:53:14'),('eaf','Enhydra Application Framework implements the Enhydra &quot;super-servlet&quot;, provides dynamic URL-JSESSIONID rewriting, PO caching, session-, database-, logging-, configuration- and XMLC APIs using adapters for different application servers.',122,'2008-03-31 20:53:14'),('eclipse-update','This project is used to manage the ObjectWeb Consortium Eclipse update sites (download.[fr2,us,zh].forge.objectweb.org/eclipse-update) which allow Eclipse users to download ObjectWeb plugins directly from Eclipse.',122,'2008-03-31 20:53:14'),('ecom','eCOM project',122,'2008-03-31 20:53:14'),('edm','A database modelling eclipse plugin for Java Data Objects. Supports the most popular Hibernate Persistence Framework.',122,'2008-03-31 20:53:14'),('enhydra','Enhydra Server is the leading Open Source Java/XML application server supporting latest Servlet and Webservice standards. Enhydra Enterprise is based on JOnAS and supports the full J2EE stack.',122,'2008-03-31 20:53:14'),('exoplatform','eXo platform product line: a Portlet Container (JSR 168 + JSR 286 + WSRP2), a Java Content Repository (JCR - JSR 170), an AJAX based Portal (with WebOS layout), a full Enterprise Content Managament (ECM) and a Collaboration Suite ',122,'2008-03-31 20:53:14'),('federid','The FederID project aim to offer a real solution of Identity Management and Identity Federation. Built on existing free software, it profits of the support and the financing of the French National Agency of Research.',122,'2008-03-31 20:53:14'),('gasp','GASP (GAming Services Platform) is a middleware for mobile multiplayer online games and implements the Open Mobile Alliance Gaming Services specs. It enables multiplayer gaming over cellular networks for J2ME phones based on MIDP &amp; Doja profiles.',122,'2008-03-31 20:53:14'),('gotm','GoTM (GoTM is an open Transaction Monitor) is a component-based framework for building various transaction services. GoTM is developped with the Fractal component model.',122,'2008-03-31 20:53:14'),('howl','HOWL is a logger implementation providing features required by the JOTM project. HOWL uses unformatted binary logs to maximize performance and specifies a journalization API with methods necessary to support JOTM recovery operations.',122,'2008-03-31 20:53:14'),('interldap','InterLDAP is an identity management project based on a Java framework. Main goals are to solve self-management, provisioning, access control and profil management.',122,'2008-03-31 20:53:14'),('introspector','The introspector project aims to create a semantic interface into the GNU GCC compiler and other free tools. The data extracted will be useful for other object brokers. Currently hosted on sourceforge, we will be migrating the project to objectweb.',122,'2008-03-31 20:53:14'),('ivy','This project is used to manage the OW2\'s Ivy Repository (ivy.objectweb.org) which allows project managers using ivy to use a commmon repository.',122,'2008-03-31 20:53:14'),('jac','Java Aspect Components (JAC) is a framework for aspect-oriented sofware development in Java.',122,'2008-03-31 20:53:14'),('jade','This project has not yet submitted a description.',122,'2008-03-31 20:53:14'),('jasmine','JASMINe is an administration tool for the SOA platform aiming to simplify the administrator\'s job and reduce the management costs. It relies on an autonomic system (Jade project) for implementing some autonomous behaviors (self-repair, self-healing).',122,'2008-03-31 20:53:14'),('javaservice','JavaService allows server-type Java programs to be run in the background as a Windows NT/2000/XP system service (aka Unix daemon process).',122,'2008-03-31 20:53:14'),('jawe','Enhydra JaWE is a graphical Java Workflow Editor according to WfMC specifications supporting XPDL as its native file format. JaWE can be used to edit workflow definitions for Enhydra Shark or every other XPDL conformant Workflow server.',122,'2008-03-31 20:53:15'),('jeffree','Java Embedded Framework Free. Based on OSGi v2.0 specification.',122,'2008-03-31 20:53:15'),('jmimetypelib','jmimetypelib is a java library used to find the mime-type of files and streams using file extension and/or magic numbers. Additionally it may return an icon to represent the mime-type file and a locale description.',122,'2008-03-31 20:53:15'),('jnetcontrol','Management and configuring network equipment with support to Telnet protocol ie: Cisco tm, 3COM.',122,'2008-03-31 20:53:15'),('jonas-doc','The jonas-doc project goal is to hold JOnAS documentation translations. The repository will contain one directory per language (French -&gt; jonas-doc-fr, German -&gt; jonas-doc-de, ...).',122,'2008-03-31 20:53:15'),('jonathan','Jonathan is an open source adaptable distributed object platform, which currently provides several personalities, including on compliant with the OMG CORBA specifications and another with the RMI specification.',122,'2008-03-31 20:53:15'),('joram','JORAM (Java Open Reliable Asynchronous Messaging) is an open source implementation of the JMS (Java Message Service) 1.1 API.',122,'2008-03-31 20:53:15'),('jorm','JORM (Java Object Repository Mapping) is an open source adaptable persistence service.',122,'2008-03-31 20:53:15'),('jotm','JOTM (Java Open Transaction Manager) is a fully functional open source standalone transaction manager that implements the XA protocol and is compliant with the JTA APIs.',122,'2008-03-31 20:53:15'),('jsurvey','The purpose of JSurvey is to provide tools for building online survey based on Java (J2EE) technologies. For the moment JSurvey is a started project so there is only a cvs repository with the sources of an online graphical survey example. see the cvs REA',122,'2008-03-31 20:53:15'),('kelp','Enhydra Kelp is the IDE plugin for JBuilder, Netbeans, Eclipse and JDeveloper integrating EAF, Enhydra XMLC and Enhydra DODS into your favorite development environment. It also includes an application wizard for your first steps.',122,'2008-03-31 20:53:15'),('kilim','Kilim is a generic configuration framework based on the concept of configuration by software assembly.',122,'2008-03-31 20:53:15'),('kilim2','This project has not yet submitted a description.',122,'2008-03-31 20:53:15'),('lemonldap','LemonLDAP is a single sign on handler for Apache web server. It manages several levels of cache and gets authentication data from an LDAP directory. It a project created and managed by  MINEFI (French economy ministary ). ',122,'2008-03-31 20:53:15'),('lewys','LeWYS is a Fractal monitoring framework providing a library of probes for both hardware and software resources. It provides monitoring pumps and repositories to efficiently gather, store and process the monitoring information.',122,'2008-03-31 20:53:15'),('lomboz','Lomboz is an eclipse plug-in for J2EE developers by extending eclipse JDT. It employs some of the proven open-source technologies. Supporting the complete development cycle: Code, deploy, test and debug.',122,'2008-03-31 20:53:15'),('maven','This project is used to manage the ObjectWeb\'s Maven Repository (maven.objectweb.org) which allows project managers using maven to use a commmon repository.',122,'2008-03-31 20:53:15'),('mesh','Mesh is a proxy for a remote JDBC driver, which can be accessed as though it were local. ',122,'2008-03-31 20:53:15'),('mobilitools','MobiliTools aims at providing a Java toolbox of independent but combinable and flexible software modules to support mobility of Java objects/agents, with a clear separation between activity, transport and communication concerns.',122,'2008-03-31 20:53:15'),('modfact','(Model Factory) is a Tool Box for the MDA(TM) (Model Driven Architecture)',122,'2008-03-31 20:53:15'),('navilis','Xcalia NAViLIS Web allows a developer to browse, query for, create, update, and delete business objects that are mapped to a live database. NAViLIS Web is like a database browser, except that the user navigates Java objects instead of database tables.',122,'2008-03-31 20:53:15'),('newsadmin','This project has not yet submitted a description.',122,'2008-03-31 20:53:15'),('noah','Noah is an implementation of an Interaction Service. &lt;br&gt;Interactions between components are described using a specific language (ISL). &lt;br&gt;Successive Adaptations are merged in a commutative and associative way.',122,'2008-03-31 20:53:15'),('odettej','Odette File Transfer Protocol (Odette FTP) is an open standard published under the Internet Engineering Task Force\'s (IETF) umbrella. The aim of this project is to develop an Odette FTP Library for Java, based on the RFC 2204 specification.',122,'2008-03-31 20:53:15'),('ofccharts','OFC Charts fills the need for publishing reports and statistics in graphical format such as curves and histograms. Fully written in JAVA and compatible with all popular IDEs it creates graphics in industry standard JPEG, PNG and SVG formats.',122,'2008-03-31 20:53:15'),('oncepi','As an Integration-Oriented business process management system, OncePI project provides a platform to construct dynamic process flexibly and efficiently.',122,'2008-03-31 20:53:15'),('opalval','Project for validation of ow2 forge',122,'2008-03-31 20:53:15'),('openediint','Open EDIINT is an open source implementation of EDIINT standards. It provides a component library and tools to build applications that allow companies to integrate with their partners, making Electronic Data Interchange over the Internet.',122,'2008-03-31 20:53:15'),('openmobileis','Open Mobile IS is a Java framework that aim to provide all the functionalities and components needed for the developpement of entreprise mobile application.',122,'2008-03-31 20:53:15'),('ops','Orbeon Forms is an open source forms solution that handles the complexity of forms typical of the enterprise or government. It is delivered to standard web browsers thanks to XForms and Ajax technology, with no need for client-side software or plugins.',122,'2008-03-31 20:53:15'),('orchestra','Orchestra is a Web Service Orchestration Suite based on the OASIS standard BPEL (Business Process Execution Language). ',122,'2008-03-31 20:53:15'),('orientwareccm','A CCM implementation in C++',122,'2008-03-31 20:53:15'),('oscar','Oscar is an open source implementation of the Open Services Gateway Initiative (OSGi) framework.',122,'2008-03-31 20:53:15'),('oyster','Enhydra Oyster is a Java library for SMIME signing and encryption using different key strengths and algorithms. It is developed with suport and testing for major E-Mail clients.',122,'2008-03-31 20:53:15'),('pargres','ParGRES is a Database Cluster Middleware whose main goal is to efficiently process heavy-weight queries (e.g. OLAP). Our query processing combines intra and inter-query parallelism, while using replication and virtual fragmentation over a PC cluster.',122,'2008-03-31 20:53:15'),('petals','The PETALS Services Platform provides a distributed open source implementation of Java Business Integration (JBI) spec as a core element to build ObjectWeb ESB solutions, leveraging existing Consortium\'s components.',122,'2008-03-31 20:53:15'),('pkuas','JOnAS PKU is a light-weight application server prototype. It functions as component operating platform based on Java/J2EE technology. It aims at exploring advanced middleware features like easy of management, flexibility, and open to change.',122,'2008-03-31 20:53:15'),('polyorb','PolyORB is a schizophrenic middleware that has an original architecture decoupling protocol personalities from application personalities. PolyORB enables in the same middleware: configurability, genericity and M2M.',122,'2008-03-31 20:53:15'),('rfid','RFID project is a collection of RFID related components and middleware available from ObjectWeb\'s software stack.',122,'2008-03-31 20:53:15'),('rubbos','RUBBoS is a bulletin board benchmark modeled after an online news forum like Slashdot. It is used for design patterns and J2EE servers performance scalability evaluation. RUBBoS provides the essential bulletin board features such as discussion threads.',122,'2008-03-31 20:53:15'),('rubis','RUBiS is an auction site prototype modeled after eBay.com. It is used for design patterns and J2EE servers performance scalability evaluation.',122,'2008-03-31 20:53:15'),('s4allsdk','S4All-SDK is a toolkit to build a Java standard based service oriented platform',122,'2008-03-31 20:53:15'),('salome-tmf','SalomeTMF is a test management tool like TestDirector (trademark of Mercury Interactive Corporation), aiming to provide an open framework allowing, the automatic tests execution, the production of documents, and the management of defects/requirements.',122,'2008-03-31 20:53:15'),('shark','Enhydra Shark is a workflow server with a difference. Shark is completely based on standards from WfMC and OMG using XPDL as its native workflow definition language. The Shark framework can be configured to support different environments.',122,'2008-03-31 20:53:15'),('snapper','Enhydra Snapper is a fulltext search library / framework in Java based on Apache Lucene to build search engine applications or integrate fulltext search into applications.',122,'2008-03-31 20:53:15'),('soda','The SODA project will develop an ecosystem (runtime and tools) for building service-oriented systems running on embedded devices. Both a C/C++ and a Java (J2ME CDC) version will be developed.',122,'2008-03-31 20:53:16'),('sofa','SOFA provides a platform for designing applications composed of hierarchical, dynamically updatable components, interconnected by connectors hiding deployment details. Communication among the components can be captured formally by behavior protocols.',122,'2008-03-31 20:53:16'),('spago','Spago is a J2EE framework that provides a solution to the needs of multichannel applications and integration services. It allows to develop web applications,integrating existing infrastructures and publishing the services on different channels.',122,'2008-03-31 20:53:16'),('spago4q','Spago4Q  is a platform for assessing the maturity of the software development process and product, by evaluating data and measures collected from the development tools with non-invasive techniques, in order to improve the overall quality.',122,'2008-03-31 20:53:16'),('spagobi','SpagoBI is a Business Intelligence Free Platform which uses many FOSS tools as analytical engines, integrating them in an infrastructure which offers a cross-operativeness and a consistent vision between Report,OLAP,Data Mining,Dashboard and over the DWH',122,'2008-03-31 20:53:16'),('starwebservice','StarWebService is an independent platform for developing, deploying, managing and running Web Services.',122,'2008-03-31 20:53:16'),('stock-online','Stock-Online is the CSIRO application used to stress middleware performance and scalability. This open-source version is implemented in EJB 1.1, and provides two alternative design choices (Session bean + JDBC, and Session bean + CMP Entity beans).',122,'2008-03-31 20:53:16'),('surf','SURF (Fault Tolerance by Replication with Universal Services) is a Java library replication service for arbitrary deterministic objects. In crash situations objects can still be accessed with replication transparent to the application developer.',122,'2008-03-31 20:53:16'),('sync4j','Funambol is a mobile application server, and more. It includes a suite of tools to develop, deploy and manage any mobile project. It is a certified implementation of the Open Mobile Alliance SyncML standards.',122,'2008-03-31 20:53:16'),('think','THINK is a software framework for building component-based system kernels. As an implementation of the Fractal model, it clearly separates architectural from functional apects, provides flexibility, encourages code re-use and reduces development time.',122,'2008-03-31 20:53:16'),('tox','This project has not yet submitted a description.',122,'2008-03-31 20:53:16'),('wcms','This project has not yet submitted a description.',122,'2008-03-31 20:53:16'),('wildcat','WildCAT is a Java toolkit/framework to make applications context-aware. It provides a simple and dynamic data model to represent the execution context of the application, which can be accessed both synchronously and synchronously (pull and push).',122,'2008-03-31 20:53:16'),('wsunit','WSUnit is a tool that can help you test Web Services. It provides a predictable and repeatable simulation of a Web Service that is ideal for unit testing.',122,'2008-03-31 20:53:16'),('xmlc','Enhydra XMLC radically simplifies web development by cleanly separating presentation from code.',122,'2008-03-31 20:53:16'),('xplus','xPlus is a implementation of the persistence provider of Enterprise Java Beans 3.0, also known as the Java Persistence API (JPA). It can be used as a stand-alone POJO persistence layer, or it can be integrated into any EJB3.0 compliant container.',122,'2008-03-31 20:53:16'),('xquare','The XQuare project provides a set of Java components for extending J2EE platforms with XML-based, heterogeneous information integration capabilities, using the XQuery language',122,'2008-03-31 20:53:16'),('xservice','XService suite, which is powered by ACT (The Institute of Advanced Computing Technology), Beihang University, Beijing, China, is a suite focus on xml and web service and provide fundamental element to enable service oriented architecture(SOA).',122,'2008-03-31 20:53:16'),('xwiki','XWiki is a second-generation wiki. See http://xwiki.org for all details.',122,'2008-03-31 20:53:16'),('zeus','Open source Java-to-XML Data Binding tool.',122,'2008-03-31 20:53:16');
